sys_variable_value.value:
(function execute(inputs, outputs) {
    if(inputs.statusCode == 200) {
        /*
        {
            "ip": "138.199.58.107",
            "city": "São Paulo",
            "region": "São Paulo",
            "country": "BR",
            "loc": "-23.5475,-46.6361",
            "org": "AS212238 Datacamp Limited",
            "postal": "01000-000",
            "timezone": "America/Sao_Paulo",
            "readme": "https://ipinfo.io/missingauth"
        }
        */

        var responseBodyParsed = JSON.parse(inputs.responseBody);
        outputs.ip = responseBodyParsed.ip;
        outputs.city = responseBodyParsed.city;
        outputs.region = responseBodyParsed.region;
        outputs.country = responseBodyParsed.country;
        
        var splitLoc = responseBodyParsed.loc.split(",");
        outputs.latitude = splitLoc[0];
        outputs.longitude = splitLoc[1];
        outputs.org = responseBodyParsed.org;
        outputs.postal = responseBodyParsed.postal;
        outputs.timezone = responseBodyParsed.timezone;
        outputs.readme = responseBodyParsed.readme;
    }
})(inputs, outputs);

